,NULL),(3119,3,182,0,'sql',0,'select\n -1 as \"minute\",\n \'UNKNOWN\' as \"desc\",\n -1 as \"hour_id\"\nunion all\nselect  \n n as \"minute\",\n concat(if (n div 60 < 10,concat(\'0\',n div 60),n div 60),\':\',if (n mod 60 < 10,concat(\'0\',n mod 60),n mod 60)) as \"desc\",\n n div 60 as \"hour_id\"\nfrom\n generator_65536\nwhere\n n < (24 * 60)'),(3120,3,182,0,'limit',0,'0'),(3121,3,182,0,'lookup',0,NULL),(3122,3,182,0,'execute_each_row',0,'N'),(3123,3,182,0,'variables_active',0,'Y'),(3124,3,182,0,'lazy_conversion_active',0,'N'),(3125,3,182,0,'cluster_schema',0,NULL),(3126,3,182,0,'row_distribution_code',0,NULL),(3127,3,183,0,'PARTITIONING_SCHEMA',0,NULL),(3128,3,183,0,'PARTITIONING_METHOD',0,'none'),(3129,3,183,0,'id_connection',1,NULL),(3130,3,183,0,'sql',0,'select\n cast(\'2000-01-01\' as date) as \"month\",\n \'UNKNOWN\' as \"desc\",\n \'UNKNOWN\' as \"month_desc\",\n 2000 as \"year_id\"\nunion all\nselect\n @dt := date_add(@dt,interval 1 month) as \"month\",\n date_format(@dt,\'%m-%Y\') as \"desc\",\n upper(date_format(@dt,\'%b %Y\')) as \"month_desc\",\n cast(date_format(@dt,\'%Y\') as unsigned) as \"year_id\"\nfrom\n generator_256,\n (select @dt := date_add(cast((select concat(date_format(min(dt_time),\'%Y-%m\'),\'-01\') from (\n   select min(time) as dt_time from stg_audits where alfresco_id=${alfresco_id}\n   union all\n   select min(cmis_creationdate) as dt_time from stg_cmis_documents where alfresco_id=${alfresco_id}\n   union all\n   select min(cmis_creationdate) as dt_time from stg_cmis_folders where alfresco_id=${alfresco_id}\n   ) t) as date),interval -1 month)) dt\nwhere\n /* 2014-07-01 - Changed to 0 month. */\n @dt < (current_date - interval 0 month)'),(3131,3,183,0,'limit',0,'0'),(3132,3,183,0,'lookup',0,NULL),(3133,3,183,0,'execute_each_row',0,'N'),(3134,3,183,0,'variables_active',0,'Y'),(3135,3,183,0,'lazy_conversion_active',0,'N'),(3136,3,183,0,'cluster_schema',0,NULL),(3137,3,183,0,'row_distribution_code',0,NULL);

